    title: "ТљР°СЂР° СЃУ©Р· 4",
    paragraphs: ["УСЂР±С–СЂ Р±Р°Р№Т›Р°Т“Р°РЅ Р°РґР°Рј Р±С–Р»СЃРµ РєРµСЂРµРє: РєТЇР»РєС– У©Р·С– Р±С–СЂ РјР°СЃС‚С‹Т› РµРєРµРЅС–РЅ, У™СЂР±С–СЂ РјР°СЃ РєС–СЃС–РґРµРЅ Т“Р°С„РёР» РєУ©Рї У©С‚РµС‚Т±Т“С‹РЅС‹РЅ РґР°, У™СЂР±С–СЂ РјР°СЃС‚С‹ТЈ СЃУ©Р№Р»РµРіРµРЅ РєРµР·С–РЅРґРµ Р±Р°СЃ Р°СѓС‹СЂС‚Р°С‚Т±Т“С‹РЅС‹РЅ. Р‘Т±Р»Р°Р№ Р±РѕР»Т“Р°РЅРґР°, РєТЇР»РєС–РіРµ СЃР°Р»С‹РЅТ“Р°РЅ РєС–СЃС– РЅРµ С€Р°СЂСѓР°РґР°РЅ, РЅРµ Р°Т›С‹Р»РґР°РЅ, РЅРµ Р±С–СЂ Т±СЏС‚ РєРµР»РµСЂР»С–Рє С–СЃС‚РµРЅ Т›Т±СЂ, Т“Р°С„РёР» РєУ©Рї У©С‚РєС–Р·С–Рї РѕС‚С‹СЂСЃР° РєРµСЂРµРє. РћСЃС‹РЅРґР°Р№ Т“Р°С„РёР»РґС–Рє РєУ©Рї У©С‚РєС–Р·С–Рї, У©Р»РјРµРіРµРЅ РєС–СЃС–РЅС–ТЈ РЅРµ РґТЇРЅРёРµРґРµ, РЅРµ Р°С…РёСЂРµС‚С‚Рµ Р±Р°СЃС‹ Р±С–СЂ Р°СѓС‹СЂРјР°Р№ Т›Р°Р»РјР°СЃР° РєРµСЂРµРє.", "УСЂР±С–СЂ СѓР°Р№С‹Рј-Т›Р°Р№Т“С‹ РѕР№Р»Р°Т“С‹С€ РєС–СЃС– РЅРµ РґТЇРЅРёРµ С€Р°СЂСѓР°СЃС‹РЅР°, РЅРµ Р°С…РёСЂРµС‚ С€Р°СЂСѓР°СЃС‹РЅР° У©Р·РіРµРґРµРЅ Р¶РёРЅР°Т›С‹СЂР°Т› Р±РѕР»СЃР° РєРµСЂРµРє. УСЂР±С–СЂ Р¶РёРЅР°Т›С‹Р»С‹Т›С‚С‹ТЈ С‚ТЇР±С– РєУ™РЅС–С€ Р±РѕР»СЃР° РєРµСЂРµРє. Р•РЅРґС– РѕР»Р°Р№ Р±РѕР»Т“Р°РЅРґР°, ТЇРЅРµРјС– СѓР°Р№С‹Рј-Т›Р°Р№Т“С‹РјРµРЅРµРЅ Р¶ТЇСЂРµ Р°Р»Р°РјС‹Р· Р±Р°? Т®РЅРµРјС– РєТЇР»РјРµР№ Р¶ТЇСЂСѓРіРµ Р¶Р°РЅ С€С‹РґР°Р№ РјР° РµРєРµРЅ? Р–РѕТ›, РјРµРЅ ТЇРЅРµРјС– СѓР°Р№С‹Рј-Т›Р°Р№Т“С‹РјРµРЅРµРЅ Р±РѕР» РґРµРјРµР№РјС–РЅ. РЈР°Р№С‹Рј-Т›Р°Р№Т“С‹СЃС‹Р·РґС‹Т“С‹ТЈР° СѓР°Р№С‹Рј-Т›Р°Р№Т“С‹ Т›С‹Р» РґР°Т“С‹, СЃРѕР» СѓР°Р№С‹Рј-Т›Р°Р№Т“С‹СЃС‹Р·РґС‹Т›С‚Р°РЅ Т›Т±С‚С‹Р»Р°СЂР»С‹Т› РѕСЂС‹РЅРґС‹ С…Р°СЂРµРєРµС‚ С‚Р°Р±Сѓ РєРµСЂРµРє Т»У™Рј Т›С‹Р»Сѓ РєРµСЂРµРє. УСЂР±С–СЂ РѕСЂС‹РЅРґС‹ С…Р°СЂРµРєРµС‚ У©Р·С– РґРµ СѓР°Р№С‹Рј-Т›Р°Р№Т“С‹РЅС‹ Р°Р·Р°Р№С‚Р°РґС‹, РѕСЂС‹РЅСЃС‹Р· РєТЇР»РєС–РјРµРЅРµРЅ Р°Р·Р°Р№С‚РїР°, РѕСЂС‹РЅРґС‹ С…Р°СЂРµРєРµС‚РїРµРЅ Р°Р·Р°Р№С‚!", "РЁС‹Т“Р°СЂ РµСЃС–РіС–РЅ С‚Р°Р±Р° Р°Р»РјР°Р№, СѓР°Р№С‹Рј-Т›Р°Р№Т“С‹РЅС‹ТЈ С–С€С–РЅРµ РєС–СЂС–Рї Р°Р»С‹Рї, Т›Р°РјР°Р»С‹Рї Т›Р°Р»РјР°Т›, РѕР» У©Р·С– РґРµ - Р±С–СЂ Р°РЅС‚Т±СЂТ“Р°РЅРґС‹Т›. Р–У™РЅРµ У™СЂР±С–СЂ Р¶Р°РјР°РЅ РєС–СЃС–РЅС–ТЈ Т›С‹Р»С‹Т“С‹РЅР° РєТЇР»СЃРµТЈ, РѕТ“Р°РЅ СЂР°С…Р°С‚С‚Р°РЅС‹Рї РєТЇР»РјРµ, С‹Р·Р° Р±РѕР»Т“Р°РЅС‹ТЈРЅР°РЅ РєТЇР», С‹Р·Р°Р»С‹ РєТЇР»РєС– - У©Р·С– РґРµ Т›Р°Р№Т“С‹. РћРЅРґР°Р№ РєТЇР»РєС–РіРµ ТЇРЅРµРјС– У©Р·С–ТЈ РґРµ СЃР°Р»С‹РЅР±Р°СЃСЃС‹ТЈ, У™СЂР±С–СЂ Р¶Р°Т›СЃС‹ Р°РґР°РјРЅС‹ТЈ Р¶Р°Т›СЃС‹Р»С‹Т› С‚Р°РїТ›Р°РЅС‹РЅР° СЂР°С…Р°С‚С‚Р°РЅС‹Рї РєТЇР»СЃРµТЈ, РѕРЅС‹ТЈ Р¶Р°Т›СЃС‹Р»С‹Т›С‚С‹ Р¶Р°Т›СЃС‹Р»С‹Т“С‹РЅР°РЅ С‚Р°РїТ›Р°РЅРґС‹Т“С‹РЅ Т“РёР±СЂР°С‚ РєУ©СЂС–Рї РєТЇР». УСЂР±С–СЂ Т“РёР±СЂР°С‚ Р°Р»РјР°Т›С‚С‹ТЈ У©Р·С– РґРµ РјР°СЃС‚С‹Т›Т›Р° Р¶С–Р±РµСЂРјРµР№, СѓР°Т›С‹С‚С‹РјРµРЅ С‚РѕТ›С‚Р°С‚Р°РґС‹. РљУ©Рї РєТЇР»РєС–РЅС–ТЈ Р±У™СЂС–РЅ РґРµ РјР°Т›С‚Р°Т“Р°РЅС‹Рј Р¶РѕТ›, РѕРЅС‹ТЈ С–С€С–РЅРґРµ Р±С–СЂ РєТЇР»РєС– Р±Р°СЂ-Р°Сѓ, Т›Т±РґР°Р№ Р¶Р°СЂР°С‚Т›Р°РЅ РѕСЂРЅС‹РјРµРЅРµРЅ С–С€С‚РµРЅ, РєУ©РєС–СЂРµРєС‚РµРЅ, Р¶ТЇСЂРµРєС‚РµРЅ РєРµР»РјРµР№РґС–, Т›РѕР»РґР°РЅ Р¶Р°СЃР°Рї, СЃС‹СЂС‚С‹РјРµРЅРµРЅ Р±РµС‚-Р°СѓР·С‹РЅ С‚ТЇР·РµРї, Р±Р°Р№-Р±Р°Р№ РєТЇР»РєС–РЅС–ТЈ У™РЅС–РЅ СЃУ™РЅРґРµРї, У™РґРµРјС–С€С–Р»С–Рє ТЇС€С–РЅ РєТЇР»РµС‚С–РЅ Р±РѕСЏРјР° РєТЇР»РєС–.", "РђРґР°Рј Р±Р°Р»Р°СЃС‹ Р¶С‹Р»Р°Рї С‚СѓР°РґС‹, РєРµР№С–Рї У©Р»РµРґС–. Р•РєС– РѕСЂС‚Р°РґР°, Р±Т± РґТЇРЅРёРµРЅС–ТЈ СЂР°С…Р°С‚С‹РЅС‹ТЈ РєР°Р№РґР° РµРєРµРЅС–РЅ Р±С–Р»РјРµР№, Р±С–СЂС–РЅ-Р±С–СЂС– Р°ТЈРґС‹Рї, Р±С–СЂС–РЅРµ-Р±С–СЂС– РјР°Т›С‚Р°РЅС‹Рї, РµСЃС–Р» У©РјС–СЂРґС– РµСЃРєРµСЂСѓСЃС–Р·, Р±РѕСЃТ›Р°, Р¶Р°СЂР°РјСЃС‹Р· Т›С‹Р»С‹Т›РїРµРЅ, Т›РѕСЂ РµС‚С–Рї У©С‚РєС–Р·РµРґС– РґРµ, С‚Р°СѓСЃС‹Р»Т“Р°РЅ РєТЇРЅРґРµ Р±С–СЂ РєТЇРЅРґС–Рє У©РјС–СЂРґС– Р±Р°СЂ РјР°Р»С‹РЅР° СЃР°С‚С‹Рї Р°Р»СѓТ“Р° С‚Р°Р±Р° Р°Р»РјР°Р№РґС‹.", "ТљСѓР»С‹Т› СЃР°СѓРјР°Т›, РєУ©Р· СЃТЇР·С–Рї, С‚С–Р»РµРЅС–Рї, Р°РґР°Рј СЃР°СѓРјР°Т› - У©РЅРµСЂСЃС–Р· РёС‚С‚С–ТЈ С–СЃС–. УСѓРµР»С– Т›Т±РґР°Р№Т“Р° СЃС‹Р№С‹РЅС‹Рї, РµРєС–РЅС€С– У©Р· Т›Р°Р№СЂР°С‚С‹ТЈР° СЃТЇР№РµРЅС–Рї, РµТЈР±РµРіС–ТЈРґС– СЃР°Сѓ, РµТЈР±РµРє Т›С‹Р»СЃР°ТЈ, Т›Р°СЂР° Р¶РµСЂ РґРµ Р±РµСЂРµРґС–, Т›Т±СЂ С‚Р°СЃС‚Р°РјР°Р№РґС‹."]
