    title: "ТљР°СЂР° СЃУ©Р· 5",
    paragraphs: ["РљУ©РєС–СЂРµРє С‚РѕР»Т“Р°РЅ Т›Р°Р№Т“С‹ РєС–СЃС–РЅС–ТЈ У©Р·С–РЅРµ РґРµ Р±РёР»РµС‚РїРµР№РґС–, Р±РѕР№РґС‹ С€С‹РјС‹СЂР»Р°С‚С‹Рї, Р±СѓС‹РЅРґС‹ Т›Т±СЂС‚С‹Рї, СЏ РєУ©Р·РґРµРЅ Р¶Р°СЃ Р±РѕР»С‹Рї Р°Т“Р°РґС‹, СЏ С‚С–Р»РґРµРЅ СЃУ©Р· Р±РѕР»С‹Рї Р°Т“Р°РґС‹. ТљР°Р·Р°Т›С‚Р°СЂ: В«У, Т›Т±РґР°Р№, Р¶Р°СЃ Р±Р°Р»Р°РґР°Р№ Т›Р°Р№Т“С‹СЃС‹Р· Т›С‹Р»Р° РіУ©СЂ!В» РґРµРї С‚С–Р»РµРє С‚С–Р»РµРіРµРЅС–РЅ У©Р·С–Рј РєУ©СЂРґС–Рј. РћРЅС‹СЃС‹ - Р¶Р°СЃ Р±Р°Р»Р°РґР°РЅ РіУ©СЂС– У©Р·С– РµСЃС‚С– РєС–СЃС– Р±РѕР»С‹Рї, РµСЃРєРµСЂРјРµСЃ РЅУ™СЂСЃРµСЃС– Р¶РѕТ›СЃС‹Рї, Т›Р°Р№Т“С‹Р»С‹ РєС–СЃС– Р±РѕР»Т“Р°РЅСЃС‹Т“Р°РЅС‹. ТљР°Р№Т“С‹СЃС‹ РЅРµ РґРµСЃРµТЈ, РјР°Т›Р°Р»РґР°СЂС‹РЅР°РЅ С‚Р°РЅС‹СЂСЃС‹ТЈ: У™СѓРµР»С– - В«РўТЇСЃС‚С–Рє У©РјС–СЂС–ТЈ Р±РѕР»СЃР°, РєТЇРЅРґС–Рє РјР°Р» Р¶РёВ», В«УЁР·С–ТЈРґРµ Р¶РѕТ› Р±РѕР»СЃР°, У™РєРµТЈ РґРµ Р¶Р°С‚В», В«РњР°Р» - Р°РґР°РјРЅС‹ТЈ Р±Р°СѓС‹СЂ РµС‚С–В», В«РњР°Р»РґС‹РЅС‹ТЈ Р±РµС‚С– - Р¶Р°СЂС‹Т›, РјР°Р»СЃС‹Р·РґС‹ТЈ Р±РµС‚С– - С€Р°СЂС‹Т›В», В«Р•СЂ Р°Р·С‹Т“С‹ РјРµРЅ Р±У©СЂС– Р°Р·С‹Т“С‹ Р¶РѕР»РґР°В», В«Р•СЂРґС–ТЈ РјР°Р»С‹ РµР»РґРµ, РµСЂС–РєРєРµРЅРґРµ Т›РѕР»РґР°В», В«Р‘РµСЂРіРµРЅ РїРµСЂРґРµ Р±Т±Р·Р°СЂВ», В«РђР»Р°Т“Р°РЅ Т›РѕР»С‹Рј - Р±РµСЂРµРіРµРЅВ», В«РњР°Р» С‚Р°РїТ›Р°РЅ РµСЂРґС–ТЈ Р¶Р°Р·С‹Т“С‹ Р¶РѕТ›В», В«Р‘Р°Р№РґР°РЅ ТЇРјС–С‚СЃС–Р· - Т›Т±РґР°Р№РґР°РЅ ТЇРјС–С‚СЃС–Р·В», В«ТљР°СЂРЅС‹ТЈ Р°С€СЃР°, Т›Р°СЂР°Р»С‹ ТЇР№РіРµ С€Р°РїВ», В«ТљР°Р№СЂР°РЅС‹ Р¶РѕТ› РєУ©Р»РґРµРЅ Р±РµР·, Т›Р°Р№С‹СЂС‹ Р¶РѕТ› РµР»РґРµРЅ Р±РµР·В» РґРµРіРµРЅ РѕСЃС‹РЅРґР°Р№ СЃУ©Р·РґРµСЂС– РєУ©Рї, РµСЃРµРїСЃС–Р· С‚РѕР»С‹Рї Р¶Р°С‚С‹СЂ.", "Р‘Т±Р» РјР°Т›Р°Р»РґР°СЂРґР°РЅ РЅРµ С€С‹Т›С‚С‹? РњР°Т“Р»Т±Рј Р±РѕР»РґС‹: Т›Р°Р·Р°Т› С‚С‹РЅС‹С€С‚С‹Т› ТЇС€С–РЅ, Т“С‹Р»С‹Рј ТЇС€С–РЅ, Р±С–Р»С–Рј ТЇС€С–РЅ, У™РґС–Р»РµС‚ ТЇС€С–РЅ Т›Р°Рј Р¶РµРјРµР№РґС– РµРєРµРЅ, РјР°Р» ТЇС€С–РЅ Т›Р°Рј Р¶РµР№РґС– РµРєРµРЅ, Р±С–СЂР°Т› РѕР» РјР°Р»РґС‹ Т›Р°Р»Р°Р№С€Р° С‚Р°Р±СѓРґС‹ Р±С–Р»РјРµР№РґС– РµРєРµРЅ, Р±Р°СЂ Р±С–Р»РіРµРЅС– РјР°Р»РґС‹Р»Р°СЂРґС‹ Р°Р»РґР°Рї Р°Р»РјР°Т› СЏРєРё РјР°Т›С‚Р°Рї Р°Р»РјР°Т› РµРєРµРЅ, Р±РµСЂРјРµСЃРµ РѕРЅС‹РјРµРЅРµРЅ Р¶Р°СѓР»Р°СЃРїР°Т› РµРєРµРЅ. РњР°Р»РґС‹ Р±РѕР»СЃР°, У™РєРµСЃС–РЅ Р¶Р°СѓР»Р°СѓРґС‹ РґР° Т±СЏС‚ РєУ©СЂРјРµР№РґС– РµРєРµРЅ. УР№С‚РµСѓС–СЂ Т±СЂР»С‹Т›, Т›СѓР»С‹Т›-СЃТ±РјРґС‹Т›, С‚С–Р»РµРЅС€С–Р»С–Рє, СЃРѕТ“Р°РЅ Т±Т›СЃР°Т“Р°РЅ Т›С‹Р»С‹Т›С‚С‹ТЈ Т›Р°Р№СЃС‹СЃС‹РЅ Р±РѕР»СЃР° РґР° Т›С‹Р»С‹Рї Р¶ТЇСЂС–Рї, РјР°Р» С‚Р°РїСЃР°, Р¶Р°Р·Р°Р»С‹ РґРµРјРµСЃРµРє РєРµСЂРµРє РµРєРµРЅ.", "Р‘Т±Р»Р°СЂРґС‹ТЈ Р¶Р°СЃ Р±Р°Р»Р°РЅС‹ТЈ Р°Т›С‹Р»С‹РЅР°РЅ РЅРµСЃС– Р°СЂС‚С‹Т›? Р‘С–СЂР°Т›, Р¶Р°СЃ Р±Р°Р»Р° Т›С‹Р·С‹Р» РѕС€Р°Т›С‚Р°РЅ Т›РѕСЂТ›СѓС€С‹ РµРґС–, Р±Т±Р»Р°СЂ С‚РѕР·Р°Т›С‚Р°РЅ РґР° Т›РѕСЂС‹Т›РїР°Р№РґС‹ РµРєРµРЅ. Р–Р°СЃ Р±Р°Р»Р° Т±СЏР»СЃР°, Р¶РµСЂРіРµ РµРЅРµ Р¶Р°Р·РґР°СѓС€С‹ РµРґС–, Р±Т±Р»Р°СЂ РЅРµРґРµРЅ Р±РѕР»СЃР° РґР° Т±СЏР»РјР°Р№РґС‹ РµРєРµРЅ. РЎРѕР» РјР° Р°СЂС‚С‹Р»Т“Р°РЅС‹? ТљРѕР»С‹РјС‹Р·РґР°Т“С‹РЅС‹ ТЇР»РµСЃС‚С–СЂС–Рї С‚Р°Р»Р°С‚РїР°СЃР°Т›, Р±С–Р· РґРµ У©Р·С–РЅРґРµР№ Р±РѕР»РјР°СЃР°Т›, Р±РµР·РµРґС– РµРєРµРЅ. Р†Р·РґРµРіРµРЅ РµР»С–РјС–Р· СЃРѕР» РјР°?"]
