    title: "ТљР°СЂР° СЃУ©Р· 6",
    paragraphs: ["ТљР°Р·Р°Т›С‚С‹ТЈ Р±С–СЂ РјР°Т›Р°Р»С‹: В«УЁРЅРµСЂ Р°Р»РґС‹ - Р±С–СЂР»С–Рє, С‹СЂС‹СЃ Р°Р»РґС‹ -С‚С–СЂР»С–РєВ» РґРµР№РґС–. Р‘С–СЂР»С–Рє Т›Р°РЅРґР°Р№ РµР»РґРµ Р±РѕР»Р°РґС‹, Т›Р°Р№С‚СЃРµ С‚Р°С‚Сѓ Р±РѕР»Р°РґС‹ - Р±С–Р»РјРµР№РґС–. ТљР°Р·Р°Т› РѕР№Р»Р°Р№РґС‹: Р±С–СЂР»С–Рє - Р°С‚ РѕСЂС‚Р°Т›, Р°СЃ РѕСЂС‚Р°Т›, РєРёС–Рј РѕСЂС‚Р°Т›, РґУ™СѓР»РµС‚ РѕСЂС‚Р°Т› Р±РѕР»СЃР° РµРєРµРЅ РґРµР№РґС–. РћР»Р°Р№ Р±РѕР»Т“Р°РЅРґР° Р±Р°Р№Р»С‹Т›С‚Р°РЅ РЅРµ РїР°Р№РґР°, РєРµРґРµР№Р»С–РєС‚РµРЅ РЅРµ Р·Р°Р»Р°Р»? РђТ“Р°Р№С‹РЅ Т›Т±СЂС‹РјР°Р№ РјР°Р» С–Р·РґРµРї РЅРµ РєРµСЂРµРє? Р–РѕТ›, Р±С–СЂР»С–Рє - Р°Т›С‹Р»Т“Р° Р±С–СЂР»С–Рє, РјР°Р»Т“Р° Р±С–СЂР»С–Рє РµРјРµСЃ. РњР°Р»С‹ТЈРґС‹ Р±РµСЂС–Рї РѕС‚С‹СЂСЃР°ТЈ, Р°С‚Р°СЃС‹ Р±Р°СЃТ›Р°, РґС–РЅС– Р±Р°СЃТ›Р°, РєТЇРЅС– Р±Р°СЃТ›Р°Р»Р°СЂ РґР° Р¶Р°Р»РґР°РЅС‹Рї Р±С–СЂР»С–Рє Т›С‹Р»Р°РґС‹! Р‘С–СЂР»С–Рє РјР°Р»Т“Р° СЃР°С‚С‹Р»СЃР°, Р°РЅС‚Т±СЂТ“Р°РЅРґС‹Т›С‚С‹ТЈ Р±Р°СЃС‹ РѕСЃС‹. РђТ“Р°Р№С‹РЅ Р°Р»РјР°Р№ Р±С–СЂР»С–Рє Т›С‹Р»СЃР° РєРµСЂРµРє, СЃРѕРЅРґР° У™СЂРєС–Рј РЅРµСЃС–Р±РµСЃС–РЅ Т›Т±РґР°Р№РґР°РЅ С‚С–Р»РµР№РґС–, У™Р№С‚РїРµСЃРµ Т›Т±РґР°Р№РґР°РЅ С‚С–Р»РµРјРµР№РґС–, С€Р°СЂСѓР° С–Р·РґРµРјРµР№РґС–. УСѓРµР»С– Р±С–СЂС–РЅРµ-Р±С–СЂС– РїУ™Р»Рµ С–Р·РґРµР№РґС–. РќРµ С‚ТЇСЃС–РЅ, РЅРµ Р°Р¶Р°СЂС‹РЅ, РЅРµ У©РєРїРµСЃС–РЅ Р±Т±Р»РґР°Рї, РѕР» Р±РѕР»РјР°СЃР°, Р±С–СЂ РїУ™Р»Рµ СЃР°Р»С‹Рї, Т›РѕСЂТ“Р°Р»Р°С‚С‹Рї, У™Р№С‚РµСѓС–СЂ Р±С–СЂС–РЅ-Р±С–СЂС– Р°Р»РґР°СѓРґС‹ТЈ Р°РјР°Р»С‹РЅ С–Р·РґРµСЃРµРґС–. РњТ±РЅС‹ТЈ Т›Р°Р№ Р¶РµСЂС–РЅРµРЅ Р±С–СЂР»С–Рє С€С‹Т›С‚С‹?", "В«Р«СЂС‹СЃ Р°Р»РґС‹ - С‚С–СЂР»С–РєВ» РґРµР№РґС–, РѕР» Т›Р°Р№ С‚С–СЂР»С–Рє? РћР» РѕСЃС‹ Р¶Р°РЅ РєРµСѓРґРµРґРµРЅ С€С‹Т›РїР°Т“Р°РЅРґС‹Т› РїР°? Р–РѕТ›, РѕРЅРґР°Р№ С‚С–СЂР»С–Рє РёС‚С‚Рµ РґРµ Р±Р°СЂ. РћРЅРґР°Р№ С‚С–СЂР»С–РєС‚С– Т›С‹РјР±Р°С‚ РєУ©СЂС–Рї, Р±Т±Р»РґР°Т“Р°РЅ Р°РґР°Рј У©Р»С–РјРґС– Р¶Р°Сѓ РєУ©СЂС–Рї, Р°С…РёСЂРµС‚РєРµ РґТ±С€РїР°РЅ Р±РѕР»Р°РґС‹. Р–Р°РЅС‹РЅ Т›РѕСЂТ“Р°Р»Р°С‚С‹Рї, Р¶Р°СѓРґР°РЅ Т›Р°С€С‹Рї, Т›РѕСЂТ›Р°Т› Р°С‚Р°РЅС‹Рї, РµТЈР±РµРє Т›С‹Р»СѓРґР°РЅ, Т›С‹Р·РјРµС‚ Т›С‹Р»СѓРґР°РЅ Т›Р°С€С‹Рї, РµСЂС–РЅС€РµРє Р°С‚Р°РЅС‹Рї, РµР· Р°С‚Р°РЅС‹Рї, РґТЇРЅРёРµРґРµ У™Р»РіС– Р°Р№С‚С‹Р»Т“Р°РЅ С‹СЂС‹СЃТ›Р° РґТ±С€РїР°РЅ Р±РѕР»Р°РґС‹. РћР» Р°Р№С‚Т›Р°РЅ С‚С–СЂР»С–Рє РѕР»Р°СЂ РµРјРµСЃ. РљУ©РєС–СЂРµРіС–, РєУ©ТЈС–Р»С– С‚С–СЂС– Р±РѕР»СЃР°, СЃРѕРЅС‹ Р°Р№С‚Р°РґС‹. УЁР·С–ТЈ С‚С–СЂС– Р±РѕР»СЃР°ТЈ РґР°, РєУ©РєС–СЂРµРіС–ТЈ У©Р»С– Р±РѕР»СЃР°, Р°Т›С‹Р» С‚Р°Р±СѓТ“Р° СЃУ©Р· Т±Т“Р° Р°Р»РјР°Р№СЃС‹ТЈ. РђРґР°Р» РµТЈР±РµРєРїРµРЅ РµСЂС–РЅР±РµР№ Р¶ТЇСЂС–Рї РјР°Р» С‚Р°Р±СѓТ“Р° Р¶С–РіРµСЂ Т›С‹Р»Р° Р°Р»РјР°Р№СЃС‹ТЈ.", "РљРµСЃРµР»РґС– Р¶Р°Р»Т›Р°Сѓ, Т›С‹Р»Р¶Р°Т›Р±Р°СЃ,", "УР·С–СЂ С‚Р°РјР°Т›, У™Р·С–СЂ Р°СЃ,", "РЎС‹СЂС‚С‹ТЈ - РїС‹СЃС‹Т›, С–С€С–ТЈ - РЅР°СЃ,", "РђСЂС‚С‹РЅ РѕР№Р»Р°Рї Т±СЏР»РјР°СЃ, -", "Р±РѕР»С‹Рї Р¶ТЇСЂС–Рї, С‚С–СЂС–РјС–РЅ РґРµРјРµ, РѕРЅР°РЅ РґР° Р°Р»Р»Р° Р¶С–Р±РµСЂРіРµРЅ Р°Т› Р±Т±Р№СЂС‹Т›С‚С‹ У©Р»С–РјРЅС–ТЈ У©Р·С– Р°СЂС‚С‹Т›."]
