    title: "ТљР°СЂР° СЃУ©Р· 12",
    paragraphs: ["РљС–РјРґРµ-РєС–Рј Р¶Р°Т›СЃС‹-Р¶Р°РјР°РЅ Т“РёР±Р°РґР°С‚ Т›С‹Р»С‹Рї Р¶ТЇСЂСЃРµ, РѕРЅС‹ РѕР» Т“РёР±Р°РґР°С‚С‚Р°РЅ С‚С‹СЋТ“Р° Р°СѓР·С‹РјС‹Р· Р±Р°СЂРјР°Р№РґС‹, У™Р№С‚РµСѓС–СЂ Р¶Р°Т›СЃС‹Р»С‹Т›Т›Р° Т›С‹Р»Т“Р°РЅ РЅРёРµС‚С‚С–ТЈ Р¶Р°РјР°РЅРґС‹Т“С‹ Р¶РѕТ› Т›РѕР№ РґРµР№РјС–Р·. Р›У™РєРёРЅ, СЃРѕРЅРґР°Р№ Р°РґР°РјРґР°СЂ С‚РѕР»С‹РјРґС‹ Т“РёР±Р°РґР°С‚Т›Р° Т“С‹Р»С‹РјС‹ Р¶РµС‚РїРµСЃРµ РґРµ, Т›С‹Р»СЃР° РµРєРµРЅ. Р‘С–СЂР°Т› РѕРЅС‹ТЈ РµРєС– С€Р°СЂС‚С‹ Р±Р°СЂ, СЃРѕРЅС‹ Р±С–Р»СЃРµ РµРєРµРЅ. УСѓРµР»С– - РёРјР°РЅРЅС‹ТЈ РёТ“С‚РёТ›Р°С‚С‹РЅ РјР°С…РєР°РјР»РµРјРµРє РєРµСЂРµРє, РµРєС–РЅС€С– - ТЇР№СЂРµРЅС–Рї Р¶РµС‚РєРµРЅС€Рµ РѕСЃС‹ РґР° Р±РѕР»Р°РґС‹ Т“РѕР№ РґРµРјРµР№, ТЇР№СЂРµРЅРµ Р±РµСЂСЃРµ РєРµСЂРµРє. РљС–РјРґРµ-РєС–Рј ТЇР№СЂРµРЅС–Рї Р¶РµС‚РїРµР№ Р¶Р°С‚С‹Рї, ТЇР№СЂРµРЅРіРµРЅС–РЅ Т›РѕР№СЃР°, РѕРЅС‹ Т›Т±РґР°Р№ Т±СЂРґС‹, Т“РёР±Р°РґР°С‚С‹ Т“РёР±Р°РґР°С‚ Р±РѕР»РјР°Р№РґС‹. РЈР°-Р»У™РєРёРЅ, РєС–РјРґРµ-РєС–Рј РёРјР°РЅРЅС‹ТЈ РЅРµС€Рµ РЅУ™СЂСЃРµ Р±С–СЂР»У™РЅ РєУ™РјУ™Р»У™С‚ С‚Р°Р±Р°С‚Т±Т“С‹РЅС‹РЅ Р±С–Р»РјРµР№, Т›Р°РЅС€Р° Р¶РµСЂРґРµРЅ Р±Т±Р·С‹Р»Р°С‚Т±Т“С‹РЅС‹РЅ Р±С–Р»РјРµР№, Р±Р°СЃС‹РЅР° С€Р°Р»РјР° РѕСЂР°Рї, Р±С–СЂУ™РґР°СЂ Р°С‚С‹РЅ РєУ©С‚РµСЂС–Рї, РѕСЂР°Р·Р°С€С‹Р», РЅР°РјР°Р·С€С‹Р» Р±РѕР»С‹Рї Р¶ТЇСЂРіРµРЅ РєУ©ТЈС–Р»РіРµ Т›Р°Р»С‹ТЈ Р±РµСЂРјРµР№ С‚Т±СЂС‹Рї, Р¶С‹СЂС‚С‹СЃС‹РЅ СЃР°Р»Т“Р°РЅТ“Р° Т±Т›СЃР°Р№РґС‹. РљТЇР·РµС‚С€С–СЃС–Р·, РµСЃРєРµСЂСѓСЃС–Р· РёРјР°РЅ С‚Т±СЂРјР°Р№РґС‹, С‹Т›С‹Р»Р°СЃС‹РјРµРЅРµРЅ У©Р·С–РЅ-У©Р·С– Р°ТЈРґС‹Рї, С€С‹РЅ РґС–РЅРё С€С‹РЅС€С‹Р»РґР°Рї Р¶Р°РЅС‹ Р°С€С‹Рї С‚Т±СЂРјР°СЃР°, СЃР°Р»Т“С‹СЂС‚С‚С‹ТЈ РёРјР°РЅС‹ Р±Р°СЂ РґРµРї Р±РѕР»РјР°Р№РґС‹."]
