    title: "ТљР°СЂР° СЃУ©Р· 18",
    paragraphs: ["РђРґР°Рј Р±Р°Р»Р°СЃС‹РЅР° Р¶С‹СЂС‚С‹Т›СЃС‹Р·, РєС–СЂСЃС–Р·, СЃС‹РїР°Р№С‹ РєРёС–РЅС–Рї, Т»У™Рј РѕР» РєРёС–РјС–РЅ Р±С‹Р»Т“Р°Рї, Р±С‹Р»Р¶С‹СЂР°С‚С‹Рї РєРёРјРµР№, С‚Р°Р·Р° РєРёРјРµРє - РґТ±СЂС‹СЃ С–СЃ. Р›У™РєРёРЅ У©Р· РґУ™СѓР»РµС‚С–РЅРµРЅ Р°СЂС‚С‹Т› РєРёС–РЅР±РµРє, РЅРµ РєРёС–РјС– Р°СЂС‚С‹Т› Р±РѕР»РјР°СЃР° РґР°, РєУ©ТЈС–Р»С–РЅРµ Т›СѓР°С‚ С‚Т±С‚С‹Рї, С‚С‹Рј Р°Р№РЅР°Р»РґС‹СЂРјР°Т› - РєРµСЂР±РµР·РґС–ТЈ С–СЃС–.", "РљРµСЂР±РµР·РґС–ТЈ РµРєС– С‚ТЇСЂР»С– Т›С‹Р»С‹Т“С‹ Р±РѕР»Р°РґС‹: Р±С–СЂС– Р±РµС‚-РїС–С€С–РЅС–РЅ, РјТ±СЂС‚С‹РЅ, РјТЇС€РµСЃС–РЅ, Р¶ТЇСЂС–СЃС–РЅ, Т›Р°СЃ-Т›Р°Р±Р°Т“С‹РЅ Т›РѕР»РґР°РЅ С‚ТЇР·РµС‚С–Рї, С€С‹РЅС‚Р°Т“С‹РЅ РєУ©С‚РµСЂС–Рї, Т›РѕР»С‹РЅ С‚Р°СЂР°Т›С‚Р°Рї У™СѓСЂРµ Р±РѕР»РјР°Т›. Р‘С–СЂРµСѓС– Р°С‚С‹РЅ, РєРёС–РјС–РЅ В«Р°Р№СЂР°РЅ С–С€РµСЂС–РјВ» РґРµРї, СЃРѕР»Р°СЂРґС‹ТЈ Р°СЂТ›Р°СЃС‹РЅРґР° СЃС‹РїР°Р№С‹, Р¶Т±Т“С‹РјРґС‹ Р¶С–РіС–С‚ Р°С‚Р°РЅР±Р°Т›Т›Р°, У©Р·С–РЅРµРЅ С–Р»РіРµСЂС–Р»РµСЂРіРµ РµР»РµСѓР»С– Р±РѕР»С‹Рї, У©Р·С– Т›Р°С‚Р°СЂРґР°Т“С‹РЅС‹ТЈ С–С€С–РЅ РєТЇР№РґС–СЂС–Рї, У©Р·С–РЅРµРЅ РєРµР№С–РЅС€С–Р»РµСЂРіРµ В«У™С‚С‚РµТЈ, РґТЇРЅРёРµ-Р°Р№, РѕСЃС‹Р»Р°СЂРґС‹ТЈ Р°С‚С‹РЅРґР°Р№ Р°С‚ РјС–РЅС–Рї, РєРёС–РјС–РЅРґРµР№ РєРёС–Рј РєРёРіРµРЅРЅС–ТЈ РЅРµ Р°СЂРјР°РЅС‹ Р±Р°СЂ РµРєРµРЅ?!В» - РґРµР№С‚Т±Т“С‹РЅ Р±РѕР»РјР°Т›Т›Р° РѕР№Р»Р°РЅР±Р°Т›.", "РњТ±РЅС‹ТЈ Р±У™СЂС– - РјР°СЃТ›Р°СЂР°Р»С‹Т›, Р°Т›С‹РјР°Т›С‚С‹Т›. РњТ±РЅС‹ Р°РґР°Рј Р±С–СЂ РѕР№Р»Р°РјР°СЃС‹РЅ, РµРіРµСЂРґРµ Р±С–СЂ РѕР№Р»Р°СЃР°, Т›Р°Р№С‚Р° Р°РґР°Рј Р±РѕР»РјР°Т“С‹ - Т›РёС‹РЅ С–СЃ. РљРµСЂР±РµР· РґРµРіРµРЅРґС– РѕСЃС‹РЅРґР°Р№ РєРµСЂ, РєРµСЂРґРµТЈ РЅРµРјРµРґРµРЅ Р±РµР·С–ТЈРґРµСЂ РґРµРіРµРЅ СЃУ©Р·РіРµ Т±Т›СЃР°С‚Р°РјС‹РЅ. РўРµРіС–РЅРґРµ, Р°РґР°Рј Р±Р°Р»Р°СЃС‹ Р°РґР°Рј Р±Р°Р»Р°СЃС‹РЅР°РЅ Р°Т›С‹Р», Т“С‹Р»С‹Рј, Р°СЂ, РјС–РЅРµР· РґРµРіРµРЅ РЅУ™СЂСЃРµР»РµСЂРјРµРЅ РѕР·Р±Р°Т›. РћРЅР°РЅ Р±Р°СЃТ›Р° РЅУ™СЂСЃРµРјРµРЅРµРЅ РѕР·РґС‹Рј Т“РѕР№ РґРµРјРµРєС‚С–ТЈ Р±У™СЂС– РґРµ - Р°Т›С‹РјР°Т›С‚С‹Т›."]
